import React from 'react';
import {MyName, CrtTech} from './App';
const ComC = () =>{
    return(
         <>
            <MyName.Consumer>
                {
                    (fName) => {
                      return (
                      <CrtTech.Consumer>{
                        (ctech) =>{
                        <> <h1>Hi {fName}</h1>
                        <h2>Above content call by create {ctech} </h2>
                        </>
                      }}</CrtTech.Consumer>
                      )
                    }
                }
              
            </MyName.Consumer>
           
         </>
    );
};

export default ComC;
